const { Controller, Get, Delete, Post, Put, Patch, Params, Body } = require('../decorator/common.decorator')
const service = require('./test.service');

@Controller('/sample')
class SampleController {
  @Get('/')
  getSample(req, res) {
    service.getAlls()
    .then((result)=>{ res.send(result)})
    .catch((error) => {
      res.send(error); 
    })
  }

  @Get('/:id')
  @Params('id')
  getSampleById(req, res, id) {
    service.getById(parseInt(id))
    .then((result)=>{res.send(result);})
    .catch((err)=>{
      res.send(error);
    })
    
  }

  @Post('/')
  @Body()
  createSample(req, res, body) {
    res.send(service.addUser(body));
  }

  @Delete('/:id')
  @Params('id')
  deleteUser(req, res, id) {
    res.send(service.deleteUser(id))
  }

  @Put('/:id')
  @Params('id')
  @Body()
  updateSample(req, res, id, body) {
    res.send(service.updateUser(id, body));
  }


  @Patch('/de/:id')
  @Params('id')
  @Body()
  updateDeSample(req, res, id, body) {
    res.send(service.updateDeUser(id, body));
  }

  
  

}

module.exports = SampleController;

