const { getCache, setCache } = require('../redis/cache.service');
let posts = [
    {
        id: 1,
        name: 'thang',
        title: 'is member NodeJS',
        description: 'Homework 79',
        email: 'levanthang@gmail.com',
    },
    {
        id: 2,
        name: 'Phúc',
        title: 'is member NodeJS',
        description: 'Homework 26',
        email: 'nguyenhuuphuc@gmail.com',
    },
];

export const getAll = () => {
    return posts;
};
export const getAlls = async () => {
    try {
        const cachedPosts = await getCache('allPost');
        if (cachedPosts) {
          return (cachedPosts);
        }
        await setCache('allPost', posts, 3600);
        return (posts);
    }catch (error) {
        return{ error: error.message };
    }
};

export const getById = async (id) => {
    try {
        let post = await getCache('Post');
        if (post) {
          return (post);
        }
        post = posts.find(post => post.id == id);
        if (!post)
            return `Not found user id : ${id}`
        await setCache('Post', post, 3600);
        return (post);
    }catch (error) {
        return{ error: error.message };
    }
};

export const addUser = (post) => {
    if (!post)
        return `Not found post`
    posts.push(post)
    return post;
};

export const updateUser = (id, post) => {
    const index = posts.findIndex((post) => post.id == id);
    if (index == -1)
        return (`Not found id : ${id}`);
    posts[index] = post;
    return post;
};

export const updateDeUser = (id, post) => {
    const index = posts.findIndex((post) => post.id == id);
    if (index == -1)
        return (`Not found id : ${id}`);
    posts[index].description = post.description;
    return posts[index];
};

export const deleteUser = (id) => {
    if (!id)
        return `Not found id : ${id}`;
    const index = posts.findIndex((post) => post.id == id);
    posts.splice(index,1)
    return `delete success user id : ${id}`;
};

export const i18n = (callback) => {
    callback(posts) ;
};

