const { Controller, Post } = require('../decorator/common.decorator');
const upload = require('./upload.config');

@Controller('/upload')
class UploadController {
  @Post('/', upload.single('file'))
  async uploadFile(req, res) {
    const file = req.file;
    console.log(file);
    if (!file) {
      return res.status(400).send('Vui lòng chọn một file để tải lên.');
    }
    // Xử lý logic tại đây, ví dụ: lưu vào cơ sở dữ liệu, trả về thông báo thành công, vv.
    return res.status(200).send('File đã được tải lên thành công.');
  }
}

module.exports = UploadController;

